pragma solidity ^0.8.26;

contract soln{
    mapping (string => address) approvers;
    uint num_of_validators;
    uint min_num_of_approvers;
    constructor(uint num) {
        num_of_validators=num;
        min_num_of_approvers=num_of_validators/2;
    }
    function generateAddress(string memory data) public pure returns (address) {
        return  address(uint160(uint256(keccak256(abi.encodePacked(data)))));
    }
    function apply_for_approver() public view returns ( address){
        return msg.sender;
    }
}

